import React, { Component } from 'react'
import { ListGroup, ListGroupItem } from 'react-bootstrap'

var taskList = [{ 'id':1, 'date': '2021-10-08', 'eventName': 'Ting-Yeh Birthday' },
                { 'id':2, 'date': '2021-10-30', 'eventName': 'Study Week Finish QQ' },
                { 'id':3, 'date': '2021-10-24', 'eventName': 'Study Week Start :)' } ,
                { 'id':4, 'date': '2021-10-08', 'eventName': 'PMC115 Quiz' }];



export default class Tasks extends Component {
    createTaskElement = task => <Task eventName={eventName} key={taskList.id} />;
    render() {
        return (
            <ListGroup>
            <ListGroupItem href="#" active>
              Link 1
            </ListGroupItem>
            <ListGroupItem href="#">Link 2</ListGroupItem>
            <ListGroupItem href="#" disabled>
              Link 3
            </ListGroupItem>
          </ListGroup>
        )
    }
}
